import React, { useEffect, useRef } from "react";
import { AgCharts } from 'ag-charts-react';
import { useFetchOccupancyDailyRatesData } from "./Hooks/useFetchOccupancyDailyRatesData";
import { filterAndProcessData } from './Utils/dataProcessing';


const OccupancyChart = ({ lgaName }) => {
    const rawData = useFetchOccupancyDailyRatesData();
    const processedData = filterAndProcessData(rawData, lgaName);

    const chartOptions = {
        data: Object.keys(processedData).map(year => ({
            name: year,
            data: processedData[year],
        })),
        series: Object.keys(processedData).map(year => ({
            type: 'line',
            xKey: 'x',
            yKey: 'y',
            title: year,
        })),
        axes: [
            { type: 'time', position: 'bottom' },
            { type: 'number', position: 'left' },
        ],
    };
    // Create a ref to hold the chart instance
    const chartRef = useRef(null);

    useEffect(() => {
        if (chartRef.current) {
            AgCharts.create(chartOptions, chartRef.current);
        }
    }, [chartOptions]);

    return <div ref={chartRef} style={{ height: '500px' }} />;
};

export default OccupancyChart;
